import React from 'react'
import propTypes from 'prop-types'

const details = ({ navigation, route}) =>{
    console.log=('on details');
    return(
        <View>
            <Image
            />
            <Text>{route.card.name}</Text>
            <Text></Text>
        </View>
    )
}

details.prototype ={
    card: propTypes.func
}

export default details
